import React from "react";
import { Heading, Divider } from "@chakra-ui/react";

function GitHubRepoSearcherHeading() {
  return (
    <div>
      <Heading as="h1" size="xl">
        GitHub Repo Searcher
      </Heading>
      <Divider my={4} />
    </div>
  );
}

export default GitHubRepoSearcherHeading;
